window.beva.locationutil = new function(){
	'use strict';
	// Add ECMA262-5 methods if not supported natively
	if (!('trim' in String.prototype)) {
	    String.prototype.trim= function() {
	        return this.replace(/^\s+/, '').replace(/\s+$/, '');
	    };
	}
	if (!('forEach' in Array.prototype)) {
	    Array.prototype.forEach= function(action, that /*opt*/) {
	        for (var i= 0, n= this.length; i<n; i++)
	            if (i in this)
	                action.call(that, this[i], i, this);
	    };
	}
	if (!('map' in Array.prototype)) {
	    Array.prototype.map= function(mapper, that /*opt*/) {
	        var other= new Array(this.length);
	        for (var i= 0, n= this.length; i<n; i++)
	            if (i in this)
	                other[i]= mapper.call(that, this[i], i, this);
	        return other;
	    };
	}
	if (!('filter' in Array.prototype)) {
	    Array.prototype.filter= function(filter, that /*opt*/) {
	        var other= [], v;
	        for (var i=0, n= this.length; i<n; i++)
	            if (i in this && filter.call(that, v= this[i], i, this))
	                other.push(v);
	        return other;
	    };
	}
	
	var locations = [], rootIndex = "0";
	var isArray = function(it){
			return Object.prototype.toString.call(it) === "[object Array]";
		},
		createOptions = function(select, index){
			var item = locations[index];
			if(item && item.children)
			{
				if(item.children.length > 1)
				{
					select.options[0] = new Option("", "");
				}
				item.children.forEach(function(idx){
					var item = locations[idx];
					select.options[select.options.length] = new Option(item.name, item.code);
				});
			}
		};
	
    /**
    @method attach
    @param {String} provId 省份选择框控件ID
    @param {String} cityId 城市选择框控件ID
    @param {String} countyId 区县选择框控件ID
    @param {String} addressId (optional) 如果提供该参数，省份城市区县选中的文字内容将显示在
		ID为addressId的地方  
    @public
	@return {Object}
    */
	this.attach = function(provId, cityId, countyId, addressId){
		var province = document.getElementById(provId),
			city = document.getElementById(cityId),
			county = document.getElementById(countyId),
			address = addressId ? document.getElementById(addressId) : undefined;
		
		var util = {
				selectProv : function(pIndex, cascading){
					if(pIndex)
					{
						province.value = pIndex;
					}
					city.options.length = county.options.length = 0;
					createOptions(city, province.value);
					if(cascading || typeof cascading === "undefined")
					{
						if(city.value)
						{
							this.selectCity(city.value);
						}
					}
				},
				selectCity : function(cIndex, cascading){
					if(cIndex)
					{
						city.value = cIndex;
					}
					if(cascading || typeof cascading === "undefined")
					{
						county.options.length = 0;
						createOptions(county, city.value);
					}
				},
				selectCoun : function(cIndex){
					if(cIndex == rootIndex)
					{
						return
					}
					if(cIndex)
					{
						county.value = cIndex;
					}
				},
				setSelectedCodes : function(code){
					if(isArray(code))
					{
						this.selectProv(code[0], true);
						this.selectCity(code[1], true);
						if(code[2] && !isNaN(parseInt(code[2])))
						{
							this.selectCoun(code[2]);
						}
					}
				},
				getSelectedCodes : function(){
					return [province.value, city.value, county.value];
				},
				getSelectedText : function(separator){
					var text = [province, city, county].map(function(select){
						if(select.selectedIndex >= 0)
						{
							return select.options[select.selectedIndex].text;
						}
					});
					return text.join(separator || "");
				}
		};
		
		province.options[0] = new Option("", "");
		createOptions(province, rootIndex);
		province.onchange = function(){
			util.selectProv();
			if(address)
			{
				address.innerHTML = util.getSelectedText();
			}
		};
		city.onchange = function(){
			util.selectCity();
			if(address)
			{
				address.innerHTML = util.getSelectedText();
			}
		};
		county.onchange = function(){
			if(address)
			{
				address.innerHTML = util.getSelectedText();
			}
		};

		return util;
	};
	
	/**
	初始化地区数据
	
	@method initData
	@param {Array} data 原始地区数据，data格式为 [itemArray, itemArray, ...]， 每个itemArray包含项内容
		itemArray[0] 省/市/区的ID
		itemArray[1] 省/市/区的名字
		itemArray[2] 省/市/区父节点ID
	@public
	*/
	this.initData = function(data){
		var prop;
		locations[rootIndex] = {name: "root", code: rootIndex, children: []};
		for(var idx in data)
		{
			prop = data[idx];
			if(!isArray(prop) || prop.length != 3)
			{
				continue;
			}
			if(isNaN(parseInt(prop[0])) || isNaN(parseInt(prop[2])))
			{
				continue;
			}
			if(locations[prop[0]])
			{
				location[prop[0]]["name"] = prop[1];
				location[prop[1]]["code"] = prop[0];
			}
			else
			{
				locations[prop[0]] = {name: prop[1], code:prop[0], children: []};
			}
			
			if(locations[prop[2]])
			{
				if(locations[prop[2]]["children"])
				{
					locations[prop[2]]["children"].push(prop[0]);
				}
				else
				{
					locations[prop[2]]["children"] = [prop[0]];
				}
			}
			else
			{
				locations[prop[2]] = {children: [prop[0]]};
			}
		}
	};

	/**
	辅助方法，通过省/市/区的代码获取其对应的文字

	@method getName
	@param {Array} code 省/市/区代码值，一般为
		code[0] 省份代码
		code[1] 城市代码
		code[2] 区县代码
	@param {String} separator 连接字符串
	@public
	@return {String}
	*/
	this.getName = function(code, separator){
		if(isArray(code))
		{
			var name = code.map(function(c){
				if(locations[c])
				{
					return locations[c]["name"];
				}
			});
			return name.join(separator || "");
		}
		return "";
	};
};
